import React from 'react';
import styled from 'styled-components';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import {PostJumbotron} from './../components/PostJumbotron';
import {Footer} from './../components/Footer';


const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;


export const Quadratic = () => {
    return (
        <Styles>
            <PostJumbotron 
                date = 'October 10th, 2019'
                title = 'What I Learned About Life From Buying a Goat on Craigslist'
                subTitle = 'One goat became two, then a whole farm, then a crash course in what really matters'>
            </PostJumbotron>
            <div style = {{ backgroundColor: '#cfcfcf'}}>
                <Container style = {{paddingTop: 30, paddingBottom: 70}} >
                    <Row>
                    </Row>
                </Container>
            </div>
            <Footer></Footer>
        </Styles>
    );
}
